// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

// ÂºïÂÖ•Âü∫Êú¨È†ÅÈù¢ÁµÑ‰ª∂
import MemberPage from './pages/MemberPage';
import MediaPage from './pages/MediaPage';
import HomePage from './pages/HomePage';
import LoginPage from './pages/LoginPage';
import BoardsIndexPage from './pages/BoardsIndexPage';
import ProfilePage from './pages/ProfilePage'; // üéØ Êñ∞Â¢ûÔºöÂÄã‰∫∫Ë≥áÊñôÈ°ØÁ§∫È†ÅÈù¢
import ProfileEditPage from './pages/ProfileEditPage'; // üéØ Êñ∞Â¢ûÔºöÂÄã‰∫∫Ë≥áÊñôÁ∑®ËºØÈ†ÅÈù¢

// ÂºïÂÖ•ÁúãÊùøÈ†ÅÈù¢ÁµÑ‰ª∂
import FoodBoardPage from './pages/FoodBoardPage';
import WeatherBoardPage from './pages/WeatherBoardPage';
import EventsBoardPage from './pages/EventsBoardPage';
import ClubsBoardPage from './pages/ClubsBoardPage';
import CoursesBoardPage from './pages/CoursesBoardPage';
import OutfitBoardPage from './pages/OutfitBoardPage';
import OtherBoardPage from './pages/OtherBoardPage';

// *** Êñ∞Â¢ûÔºöÂºïÂÖ•Ë≤ºÊñáÁõ∏ÈóúÁµÑ‰ª∂ ***
import PostForm from './components/PostForm'; // ÂÅáË®≠ PostForm ÊòØ components Á¥öÂà•
import PostDetailPage from './pages/PostDetailPage'; // ÂÅáË®≠ PostDetailPage ÊòØ pages Á¥öÂà•


function App() {
  return (
    <Router>
      <Routes>
        {/* È¶ñÈ†Å */}
        <Route path="/" element={<HomePage />} />
        
        {/* ÁôªÂÖ•Ë°®ÂñÆËàáÊúÉÂì°ÂäüËÉΩ */}
        <Route path="/login" element={<LoginPage />} />

        {/* ÊúÉÂì°ÁõÆÈåÑÈ†ÅÈù¢Ë∑ØÁî± */}
        <Route path="/members" element={<MemberPage />} />
        
        {/* üéØ ÊúÉÂì°ÂÄã‰∫∫Ê™îÊ°àÈ†ÅÈù¢Ë∑ØÁî± */
        /* /profile È°ØÁ§∫ÂÄã‰∫∫Ë≥áÊñô */
        /* /profile/edit Á∑®ËºØÂÄã‰∫∫Ë≥áÊñô */
        }
        <Route path="/profile" element={<ProfilePage />} />
        <Route path="/profile/edit" element={<ProfileEditPage />} />
        
        {/* ÁúãÊùøÂ∞éË¶ΩÈ†Å */}
        <Route path="/boards" element={<BoardsIndexPage />} />
        
        {/* 1. ÂêÑÂà•ÁúãÊùøÈ†ÅÈù¢Ë∑ØÁî± (‰øùÊåÅ‰∏çËÆä) */}
        <Route path="/boards/food" element={<FoodBoardPage />} />
        <Route path="/boards/weather" element={<WeatherBoardPage />} />
        <Route path="/boards/events" element={<EventsBoardPage />} />
        <Route path="/boards/clubs" element={<ClubsBoardPage />} />
        <Route path="/boards/courses" element={<CoursesBoardPage />} />
        <Route path="/boards/outfit" element={<OutfitBoardPage />} />
        <Route path="/boards/other" element={<OtherBoardPage />} />

        {/* 2. Ë≤ºÊñáÁõ∏ÈóúË∑ØÁî± (ÂãïÊÖãË∑ØÁî±) */}
        
        {/* ÁôºË°®Êñ∞Ë≤ºÊñáÔºö/boards/:boardId/new (ÂÅáË®≠ÊÇ®Âú® BoardPage ÂÖßÁÆ°ÁêÜË°®ÂñÆÁãÄÊÖãÔºåÊ≠§Ë∑ØÁî±Áî®ÊñºÂÖ®ÂüüÂâµÂª∫) */}
        {/* Â¶ÇÊûúÊØèÂÄãÁúãÊùøÈ†ÅÈù¢ÔºàÂ¶Ç FoodBoardPageÔºâÂÖßÂµå‰∫ÜÁôºÂ∏ÉÈÇèËºØÔºåÂâáÂèØËÉΩ‰∏çÈúÄË¶ÅÈÄôÂÄãÂÖ®ÂüüË∑ØÁî±„ÄÇ */}
        {/* ÁÇ∫‰∫ÜÂΩàÊÄßÔºåÊàëÂÄëÊñ∞Â¢û‰∏ÄÂÄãÂãïÊÖãÁôºÂ∏ÉË∑ØÁî±„ÄÇ */}
        <Route path="/boards/:boardId/new" element={<PostForm />} />
        
        {/* Ë≤ºÊñáË©≥ÊÉÖÈ†ÅÈù¢Ôºö/boards/:boardId/:postId */}
        {/* ‰æãÂ¶ÇÔºö/boards/food/123456 Êàñ /boards/courses/7890 */}
        <Route path="/boards/:boardId/:postId" element={<PostDetailPage />} />
        
        {/* Â™íÈ´îË≥áÊ∫êÈ†ÅÈù¢Ë∑ØÁî± */}
        <Route path="/media" element={<MediaPage />} />
        
      </Routes>
    </Router>
  );
}

export default App;
